import React, { FunctionComponent, useState} from 'react';
import { bluetoothOutline, checkmarkOutline, closeOutline } from 'ionicons/icons';

import './BluetoothDeviceItem.css';

import { BluetoothDevice } from '../../interfaces/BluetoothDevice'

interface Props {
  device: BluetoothDevice;
}

class BluetoothDeviceItem extends React.Component {

  render() {
    return (
      <div className="main-container">
        <strong>{device.name}</strong>
        <p>Explore <a target="_blank" rel="noopener noreferrer" href="https://ionicframework.com/docs/components">UI Components</a></p>
      </div>
    );
  }
}
